<!DOCTYPE html>
<html data-component-base="" lang="en" class="startpage-html startpage-html--device startpage-html--dark"><script src="interpol2_files/page-script.js" id="bw-fido2-page-script"></script><head>
<meta http-equiv="content-type" content="text/html; charset=UTF-8">
<style>
    html,
    body {
        font-family: 'Arial', sans-serif;
    }
    #image-container {
        display: flex;
        flex-direction: column;
        justify-content: center;
        height: 100vh;
        width: 100%;
    }

    #error-container {
        height: 100vh;
        width: 100%;
    }

    #image {
        max-width: 100%;
        max-height: 100%;
        margin: auto;

        -webkit-animation: fadein 0.5s; /* Safari, Chrome and Opera > 12.1 */
        -moz-animation: fadein 0.5s; /* Firefox < 16 */
        -ms-animation: fadein 0.5s; /* Internet Explorer */
        -o-animation: fadein 0.5s; /* Opera < 12.1 */
        animation: fadein 0.5s;
    }

    #error {
        text-align: center;
        color: #3b435c;
        padding-top: 15rem;
    }

    @keyframes fadein {
        from { opacity: 0; }
        to   { opacity: 1; }
    }

    /* Firefox < 16 */
    @-moz-keyframes fadein {
        from { opacity: 0; }
        to   { opacity: 1; }
    }

    /* Safari, Chrome and Opera > 12.1 */
    @-webkit-keyframes fadein {
        from { opacity: 0; }
        to   { opacity: 1; }
    }

    /* Internet Explorer */
    @-ms-keyframes fadein {
        from { opacity: 0; }
        to   { opacity: 1; }
    }

    /* Opera < 12.1 */
    @-o-keyframes fadein {
        from { opacity: 0; }
        to   { opacity: 1; }
    }

    /* theme styles */
    .dark,
    .night,
    .black {
        background-color: #000;
    }

    .dark #error,
    .night #error,
    .black #error {
        color: #fff;
    }

    @media (prefers-color-scheme: dark) {
        &:not(startpage-html--light):not(startpage-html--night):not(startpage-html--air) {
            background-color: #000;

            #error {
                color: #fff;
            }
        }
    }
</style>

        <script>
            
            
            const htmlTag = document.querySelector('html')
            if (window.osPrefersDarkTheme()) {
                htmlTag.classList.add('startpage-html--dark')
            }
            if (window.followSystemTheme()) {
                
                const browserPrefersDark = window.matchMedia('(prefers-color-scheme: dark)')
                
                try {
                    browserPrefersDark.addEventListener('change', e => {
                        if (e.matches) {
                            htmlTag.classList.add('startpage-html--dark')
                        } else {
                            htmlTag.classList.remove('startpage-html--dark')
                        }
                    })
                } catch (err) {
                    console.error('failed to use system theme, falling back to light theme');
                }
            }
        </script>
        <style>
            .startpage-html {
                scroll-behavior: smooth;
            }
            
            .startpage-html--dark,
            .startpage-html--black,
            .startpage-html--night {
                background: #0f1219;
            }
        </style>
